CEPHALOTHORAX: Carapace orange-brown, shiny, finely reticulate; suffused with dark gray along radiating lines and pars cephalica. Clypeus height 3 . Sternum completely suffused with dark gray. Chelicerae orange-brown, not excavated; seta-tipped tubercles absent; promargin three denticles, retromargin one small apical denticle. Cheliceral stridulatory organ visible ~ 14 striae, well spaced followed by 28 closely spaced striae. ABDOMEN: Coloration highly variable; uniformly dark gray or dark gray with some off-white specks or else with dark median band and dark lateral sides (
Fig. 189
). LEGS : Light yellow-orange; leg I total length: 4.31; leg III total length: 2.87; Tm I: 0.30, Tm IV: absent. GENITALIA: Palpal retrolateral tibial apophysis small, triangular; dorsal tibial apophysis smooth; two retrolateral trichobothria and a dorsal one (
Fig. 185
). Cymbium with retrolateral fold; glabrous depression present (
Fig. 185
); dorsal and ventral cymbial tubercles reduced, slightly rugose; prolateral notch absent (
Fig. 186
